(5, 'Comment utiliser les informations fournies par les bracelets Captair ?', 'Les informations collectes par les bracelets Captair sont disponibles en temps rel sur \r\nnotre site web dans l\'onglet \"donnes\". Vous pouvez galement paramtrer \r\ndes alertes pour tre inform en temps rel des perturbations sur le rseau.'),
(6, 'Qu\'arrive-t-il si mon bracelet Captair ne fonctionne plus ?', 'Si votre bracelet Captair ne fonctionne plus correctement, \r\nn\'hsitez pas  nous contacter pour que nous puissions vous aider  rsoudre le problme. \r\nNous disposons d\'un service d\'assistance clientle ddi qui se tient  votre disposition pour rpondre\r\n toutes vos questions et vous aider  rsoudre les problmes ventuels.'),
(7, 'Est-il possible de consulter l\'tat du rseau de mtro  Paris sans possder un bracelet Captair ?', 'Oui, il est possible de consulter l\'tat du rseau de mtro  Paris mme si vous ne possdez \r\npas un bracelet Captair. Les informations collectes par nos utilisateurs quips de bracelets sont disponibles en temps rel sur notre application mobile, \r\net sont accessibles  tous les utilisateurs. \r\nIl vous suffit de tlcharger l\'application et de vous connecter pour avoir accs  ces informations.'),
(8, 'Comment jumeler sa montre avec son compte ? ', 'Pour synchroniser votre montre avec votre compte, \r\nil suffit de suivre ces quelques tapes.\r\n Lors de l\'acquisition de votre montre, vous recevrez un code de jumelage unique. \r\nEn accdant  votre compte en ligne, \r\nvous pourrez entrer ce code pour tablir une liaison entre votre montre et votre compte. \r\nCette opration ne prend que quelques minutes \r\net vous permettra de bnficier des fonctionnalits de votre montre de manire optimale.'),
(9, 'Quel est le dlai de prparation et d\'expdition pour les commandes ?', 'Concernant le dlai de prparation et d\'expdition des commandes, \r\nsachez que ds validation de votre commande, celle-ci sera mise en fabrication.\r\n Il faut gnralement compter entre une  deux semaines pour la rception de votre commande, \r\naprs expdition de celle-ci. Nous nous efforons de maintenir des dlais d\'expdition aussi courts que\r\n possible tout en garantissant la qualit de nos produits.\r\n N\'hsitez pas  nous contacter pour toutes questions supplmentaires.'),
(11, 'Quelle est la fonction principale de nos bracelets Captair ?', 'Notre entreprise Captair a pour objectif de fournir des bracelets quips de capteurs pour permettre aux utilisateurs de connatre l\'tat en temps rel du rseau de mtro  Paris. En utilisant une flotte d \'utilisateurs quips de nos bracelets, nous pouvons fournir des informations sur l\'tat du rseau de manire prcise.');
